function Compare() {
  return (
    <>
      <div className="text-center">
        <h2 className="text-black text-3xl">Compare moving companies like:</h2>
      </div>
      <div>
        <img src="images/" alt="" />
      </div>
    </>
  );
}

export default Compare;
